import React from 'react';
import './App.css';
import Novels from "./Components/Novels"
import Twitch from "./Components/Twitch";
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Router, Route, IndexRoute, Switch} from "react-router";


function Home(){
  return <div>Yo welcome</div>
}

class App extends React.Component {
  render() {
    return (
      <div className="content-head">
        <Router>
        <Navbar bg="dark" variant="dark" fixed="top">

          <Navbar.Brand href="#home">KCashew's Home Page</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/novels">Web Novels</Nav.Link>
            <Nav.Link href="/twitch">Twitch</Nav.Link>
          </Nav>

        </Navbar>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/novels">
            <Novels />
          </Route>
          <Route path="/twitch">
            <Twitch />
          </Route>
        </Switch>
        </Router>

        <div className="content-main">
        </div>

      </div>
    );
  }
}
export default App;
